<ul>
<li><strong>\u4E8C\u8FDB\u5236\u6216\u8FD0\u7B97\u7B26</strong>(or): \u7B26\u53F7\u4E3A <code v-pre>|</code>\uFF0C\u8868\u793A\u82E5\u4E24\u4E2A\u4E8C\u8FDB\u5236\u4F4D\u90FD\u4E3A <code v-pre>0</code>\uFF0C\u5219\u7ED3\u679C\u4E3A <code v-pre>0</code>\uFF0C\u5426\u5219\u4E3A <code v-pre>1</code>\u3002</li>
<li><strong>\u4E8C\u8FDB\u5236\u4E0E\u8FD0\u7B97\u7B26</strong>(and): \u7B26\u53F7\u4E3A <code v-pre>&amp;</code>\uFF0C\u8868\u793A\u82E5\u4E24\u4E2A\u4E8C\u8FDB\u5236\u4F4D\u90FD\u4E3A 1\uFF0C\u5219\u7ED3\u679C\u4E3A 1\uFF0C\u5426\u5219\u4E3A 0\u3002</li>
<li><strong>\u4E8C\u8FDB\u5236\u5426\u8FD0\u7B97\u7B26</strong>(not): \u7B26\u53F7\u4E3A <code v-pre>~</code>\uFF0C\u8868\u793A\u5BF9\u4E00\u4E2A\u4E8C\u8FDB\u5236\u4F4D\u53D6\u53CD\u3002</li>
<li><strong>\u5F02\u6216\u8FD0\u7B97\u7B26</strong>(xor): \u7B26\u53F7\u4E3A <code v-pre>^</code>\uFF0C\u8868\u793A\u82E5\u4E24\u4E2A\u4E8C\u8FDB\u5236\u4F4D\u4E0D\u76F8\u540C\uFF0C\u5219\u7ED3\u679C\u4E3A 1\uFF0C\u5426\u5219\u4E3A 0\u3002</li>
<li><strong>\u5DE6\u79FB\u8FD0\u7B97\u7B26</strong>(left shift): \u7B26\u53F7\u4E3A <code v-pre>&lt;&lt;</code>\uFF0C\u8BE6\u89C1\u4E0B\u6587\u89E3\u91CA\u3002</li>
<li><strong>\u53F3\u79FB\u8FD0\u7B97\u7B26</strong>(right shift): \u7B26\u53F7\u4E3A <code v-pre>&gt;&gt;</code>\uFF0C\u8BE6\u89C1\u4E0B\u6587\u89E3\u91CA\u3002</li>
<li><strong>\u5934\u90E8\u8865\u96F6\u7684\u53F3\u79FB\u8FD0\u7B97\u7B26</strong>(zero filled right shift): \u7B26\u53F7\u4E3A <code v-pre>&gt;&gt;&gt;</code>\uFF0C\u8BE6\u89C1\u4E0B\u6587\u89E3\u91CA\u3002</li>
</ul>
